import React from 'react';

function Head (props){
        return(
            <head>
            <title>schpiel - Applying, Made Easier</title>
    
            <meta name = "viewport" content = "width=device-width, initial-scale=1.0" />
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
        
            <meta charSet="utf-8" />
            <meta name = "description" content = "schpiel, like the name implies, makes applying easier. no, it doesn't sound like that? :(. Using our new autofill feature, with one click you can apply instantly!" />
        

            <link rel="stylesheet" href="style.css" />
            <link rel="preconnect" href="https://fonts.googleapis.com" />
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin />
            <link href="https://fonts.googleapis.com/css2?family=Roboto+Mono:ital,wght@1,300&family=Roboto+Slab&display=swap" rel="stylesheet" />
            <link rel="icon" href="https://i.imgur.com/RoPgdJh.jpg" />

            </head>
        );
    }

export default Head;
